const INTIAL_STATE = {
    userName: '',
    profile: {
        first_name: '',
        last_name: '',
        address: {
            street: '',
        },
        email: undefined,
    }
};


export default function (state = INTIAL_STATE, action) {

    switch (action.type) {

        case 'Login_Success':
            let obj = Object.assign({}, state,
                {
                    userName: action.loginUser,
                    email: '',
                });
            return obj;

        case 'Logout':
            let obj1 = Object.assign({}, state,
                {
                    userName: '',
                });
            return obj1;

        default:
            return state;
    }
}
